<item>
<title>2007-06-22 17:23:17</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerZavedenijaOdnogoAdresaNeskol'koRaz/show&amp;time=2007-06-22+17%3A23%3A17</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerZavedenijaOdnogoAdresaNeskol'koRaz&amp;amp;v=z6v" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Операторы&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Edit&amp;nbsp;Operators&amp;nbsp;/&amp;nbsp;Пример&amp;nbsp;Заведения&amp;nbsp;Одного&amp;nbsp;Адреса&amp;nbsp;Несколько&amp;nbsp;Раз&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerZavedenijaOdnogoAdresaNeskol'koRaz&amp;amp;time=2007-06-22+17%3A23%3A17">2007-06-22 17:23:17&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/PrimerZavedenijaOdnogoAdresaNeskol'koRaz&amp;amp;time=2007-06-26+12%3A43%3A35">2007-06-26 12:43:35&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Для&amp;nbsp;выполнения этих условий нужно выполнить следующие действия:&lt;br />
&lt;strong>3.&lt;/strong> Выбираем первый сайт оператора &lt;em>(Test_oper_1)&lt;/em>, редактируем сайт и&amp;nbsp;добавляем к&amp;nbsp;нему тарифный план для&amp;nbsp;всего мира, трафик которого должен будет идти без&amp;nbsp;префикса &amp;ndash; &lt;em>Test_oper_term&lt;/em>.&lt;br />
&lt;strong>4.&lt;/strong> В&amp;nbsp;секцию шлюзов на&amp;nbsp;первом сайте добавляем ip-адрес шлюза оператора (по правилам заведения нового шлюза), поля &lt;strong>&amp;#147;Dst_translate&amp;#148;&lt;/strong> и&amp;nbsp;&lt;strong>&amp;#147;In_dst_translate&amp;#148;&lt;/strong> оставляем пустыми.&lt;br />
&lt;strong>5.&lt;/strong> Выбираем второй сайт оператора &lt;em>(Test_oper_1_Vt)&lt;/em>, редактируем сайт и&amp;nbsp;добавляем  к&amp;nbsp;нему тариф с&amp;nbsp;направлениями Вьетнама &lt;em>(Test_Oper1_Vt_term)&lt;/em>, трафик которого должен идти с&amp;nbsp;префиксом &amp;ndash; &lt;strong>100&lt;/strong>. &lt;br />
&lt;ul>&lt;li> в&amp;nbsp;открывшемся окне параметров шлюза, проверяем, что&amp;nbsp;все параметры полностью совпадают с&amp;nbsp;параметрами первого шлюза (GW ID&amp;nbsp;должен быть таким же, как&amp;nbsp;и&amp;nbsp;на первом сайте шлюза),&lt;/li>&lt;/ul>
&lt;span class="cite">&lt;strong>Важно:&lt;/strong> Один и&amp;nbsp;тот же&amp;nbsp;ip-адрес можно использовать в&amp;nbsp;системе несколько раз, только если поля оба&amp;nbsp;поля “Dst_translate" и&amp;nbsp;&amp;laquo;In_dst_translate” у&amp;nbsp;этих одинаковых адресов будут разными.&lt;/span>&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Для&amp;nbsp;выполнения этих условий, нужно выполнить следующие действия:&lt;br />
&lt;strong>3.&lt;/strong> Выбераем первый сайт оператора &lt;em>(Test_oper_1)&lt;/em>, редактируем сайт и&amp;nbsp;добавляем к&amp;nbsp;нему тарифный план для&amp;nbsp;всего мира, трафик которого должен будет идти без&amp;nbsp;префикса &amp;ndash; &lt;em>Test_oper_term&lt;/em>.&lt;br />
&lt;strong>4.&lt;/strong> В&amp;nbsp;секцию шлюзов на&amp;nbsp;первом сайте, добавляем ip-адрес шлюза оператора (по правилам заведения нового шлюза), поля &lt;strong>&amp;#147;Dst_translate&amp;#148;&lt;/strong> и&amp;nbsp;&lt;strong>&amp;#147;In_dst_translate&amp;#148;&lt;/strong> оставляем пустыми.&lt;br />
&lt;strong>5.&lt;/strong> Выбираем второй сайт оператора &lt;em>(Test_oper_1_Vt)&lt;/em>, редактируем сайт и&amp;nbsp;добавляем  к&amp;nbsp;нему тариф с&amp;nbsp;направлениями Вьетнама &lt;em>(Test_Oper1_Vt_term)&lt;/em>, трафик которых должен идти с&amp;nbsp;префиксом &amp;ndash; &lt;strong>100&lt;/strong>. &lt;br />
&lt;ul>&lt;li> в&amp;nbsp;открывшемся окне параметров шлюза, проверяем, что&amp;nbsp;все параметрый полностью совпадают с&amp;nbsp;параметрами первого шлюза (GW ID&amp;nbsp;должен быть таким же, как&amp;nbsp;и&amp;nbsp;на первом шлюза),&lt;/li>&lt;/ul>
&lt;span class="cite">&lt;strong>Важно:&lt;/strong> Один и&amp;nbsp;тот же&amp;nbsp;ip-адрес можно использовать в&amp;nbsp;системе несколько раз&amp;nbsp;только, если поля оба&amp;nbsp;поля “Dst_translate" и&amp;nbsp;&amp;laquo;In_dst_translate” у&amp;nbsp;этих одинаковых адресов будут разными.&lt;/span>&lt;/div>&lt;/div>
</description>
</item>
